import SearchBar from "react-native-dynamic-search-bar";

const Search = () => {
    return (
        <div className="search">
            <h2>Search for a Plate</h2>
            <SearchBar
                placeholder="Search here"
                onPress={() => alert("onPress")}
                onChangeText={(text) => console.log(text)}
            />
        </div>
    );
}

export default Search;
